import React from "react";
import {FaBars, FaTimes} from "react-icons/fa"
import { useRef } from "react";

function Navbar(){
    
    return(
        <header>
            <h3>Logo</h3>
            <nav>
                <a href="/#">Home</a>
                <a href="/#">My work</a>
                <a href="/#">Blog</a>
                <a href="/#">About Me</a>
                <button>
                    <FaTimes/>
                </button>
            </nav>
            <button>
                <FaBars/>
            </button>
        </header>
    );
}

export default Navbar;
